import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import Home from './components/home';
import Profile from './components/profile';


function App() {
  return (
    <Router>
      <Switch>
        <Route path={['/','/home']} exact >
          <Home/>
        </Route>

        <Route path="/profile">
          <Profile/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
